function makeDynamic(b){var a=$(b).attr("href");$(b).click(function(c){c.preventDefault();$("#pageContent").fadeOut(50,function(){var d=a.replace("modul/","").replace(".php","");goBack(a)})})}function goBack(a){if(a){$("#pageContent").load(a,function(c,b,e){if(b=="error"){var d="makeDynamic Error";console.log(d+e.status+" "+e.statusText);window.location.replace("logout.php")}else{$("#pageContent").fadeTo(50,1)}})}}$(document).ready(function(){$(window).on("popstate",function(b){var a=history.state.info;$("#pageContent").fadeOut("fast",function(){goBack(a)})});$(".navbar-collapse a").click(function(a){a.preventDefault;$(".navbar-collapse").collapse("hide")});$("#pageContent").load($("#pageContent").attr("page"),function(){var a={info:$("#pageContent").attr("page")};history.pushState(a,"index.php")});$(".nav-link").each(function(){makeDynamic(this)});$(".navbar-brand").each(function(){makeDynamic(this)})});